import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          <div className="App-logo" >
               <img src="https://www.homegate.ch/static/images/homegate-logo.svg" alt="Homegate logo" />
            </div>
        </p>
      </header>
    </div>
  );
}

export default App;
